import 'bootstrap/dist/css/bootstrap.min.css';
import { NavigateFunction, useNavigate } from "react-router-dom";
import Cookies from 'js-cookie';
import axios from "axios";
import { useState,useEffect } from 'react';

const App = () =>{

  const [itemdata,setItemdata] = useState<Array<object>>([]);
  const Navigate:NavigateFunction = useNavigate();
  const cookie = document.cookie;
  const reg = () =>{
    Navigate('/register')
  }
  const login = () =>{
    Navigate('/login')
  }
  const logout = () =>{
    Cookies.remove('access_token');
    Navigate('/login')
  }
  const fetchdetail =async () =>{
    const fetchdetail = await axios.get('http://localhost:5050/fetchdetail', { withCredentials: true })
    const res:Array<object> = [fetchdetail.data];
    console.log(res[0]);

    // const fetchItem = res.f

    // const dataforitem:Array = res.fetchItem.map((t1: any) => ({
    //   ...t1,
    //   ...dataauth.find((t2: any) => t2.prime_book_id === t1.prime_book_id),
    // }));

      setItemdata(res)
  }

  useEffect(() => {
    fetchdetail();
  },[]);

 if (!cookie) {
  return(
    <><h1>Access deined</h1></>
)
 }
 else{  
  return(
  <>
  <section className="vh-100">
  <div className='vh-100 gradient-custom'>
  <div className='d-flex justify-content-between m-auto' style={{height:"10%"}}>
    <div>
    <button className='btn btn-primary m-3' onClick={reg}>Registration</button>
    <button className='btn btn-primary' onClick={login}>Login</button>
    </div>
    <div>
    <button className='btn btn-danger m-3' onClick={logout}>LOG OUT</button>
    </div>
</div>
    <div className="bg-body-secondary d-flex flex-column m-auto" style={{height:"85%",width:"95%"}}>
    <section  style={{ backgroundColor: "#eee" ,overflow:"scroll"}}>
        <div className="row justify-content-center mb-3">
          <div className="col-md-12 col-xl-10">
            <div className="cards shadow-0 border rounded-3">
              <div className="card-body">
                <div className="row">
                  <div className="col-md-12 col-lg-3 col-xl-3 mb-4 mb-lg-0">
                    <div className="bg-image hover-zoom ripple rounded ripple-surface">
                      <img src="https://mdbcdn.b-cdn.net/img/Photos/Horizontal/E-commerce/Products/img%20(4).webp"
                        className="w-100" />
                      <a href="#!">
                        <div className="hover-overlay">
                          <div className="mask" ></div>
                        </div>
                      </a>
                    </div>
                  </div>
                  <div className="col-md-6 col-lg-6 col-xl-6">
                    <h5>Quant trident shirts</h5>
                    <div className="d-flex flex-row">
                      <div className="text-danger mb-1 me-2">
                        <i className="fa fa-star"></i>
                        <i className="fa fa-star"></i>
                        <i className="fa fa-star"></i>
                        <i className="fa fa-star"></i>
                      </div>
                      <span>310</span>
                    </div>
                    <div className="mt-1 mb-0 text-muted small">
                      <span>100% cotton</span>
                      <span className="text-primary"> • </span>
                      <span>Light weight</span>
                      <span className="text-primary"> • </span>
                      <span>Best finish<br /></span>
                    </div>
                    <div className="mb-2 text-muted small">
                      <span>Unique design</span>
                      <span className="text-primary"> • </span>
                      <span>For men</span>
                      <span className="text-primary"> • </span>
                      <span>Casual<br /></span>
                    </div>
                    <p className="text-truncate mb-4 mb-md-0">
                      There are many variations of passages of Lorem Ipsum available, but the
                      majority have suffered alteration in some form, by injected humour, or
                      randomised words which don't look even slightly believable.
                    </p>
                  </div>
                  <div className="col-md-6 col-lg-3 col-xl-3 border-sm-start-none border-start">
                    <div className="d-flex flex-row align-items-center mb-1">
                      <h4 className="mb-1 me-1">$13.99</h4>
                      <span className="text-danger"><s>$20.99</s></span>
                    </div>
                    <h6 className="text-success">Free shipping</h6>
                    <div className="d-flex flex-column mt-4">
                      <button data-mdb-button-init data-mdb-ripple-init className="btn btn-primary btn-sm" type="button">Details</button>
                      <button data-mdb-button-init data-mdb-ripple-init className="btn btn-outline-primary btn-sm mt-2" type="button">
                        Add to wishlist
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
    </section>
    </div>
  </div>
    </section>
  </>
 )
}
}
export default App;
